static void led_event_cb(lv_event_t *e) {
    lv_obj_t *led = (lv_obj_t *)lv_event_get_user_data(e);
    lv_obj_t *sw = lv_event_get_target(e); 
    if (lv_obj_get_state(sw) & LV_STATE_CHECKED) {
      lv_led_on(led);
      Buzzer_On();
    } 
    else {
      lv_led_off(led);
      Buzzer_Off();
    }
}

// Movement parameters
static int dx1 = 3;  // Horizontal speed
static int dy1 = 2;  // Vertical speed

static int dx2 = 5;  // Horizontal speed
static int dy2 = 1;  // Vertical speed

static int dx3 = 2;  // Horizontal speed
static int dy3 = 6;  // Vertical speed

static lv_obj_t *led1, *led2, *led3;
static int led_width = 20;  // Approximate width of the LED
static int led_height = 20;
lv_coord_t x1=50,y_1=50;
lv_coord_t x2=30,y2=20;
lv_coord_t x3=20,y3=10;

lv_obj_t *led;

static void move_led_cb(lv_timer_t * timer) {
     // x = lv_obj_get_x(led2);
    //  y = lv_obj_get_y(led2);

    // Get screen size
    lv_coord_t scr_w = 240;//lv_disp_get_hor_res(NULL);
    lv_coord_t scr_h = 240;//lv_disp_get_ver_res(NULL);

    // Update position
    x1 += dx1;
    y_1 += dy1;

    x2 += dx2;
    y2 += dy2;

    x3 += dx3;
    y3 += dy3;

    // Bounce logic
     if (x1 <= 0 || x1 >= scr_w - led_width) {
        dx1 = -dx1;
        dx1 += (rand() % 3) - 1;  // Add some randomness (-1 to +1)
    }
    if (y_1 <= 0 || y_1 >= scr_h - led_height) {
        dy1 = -dy1;
        dy1 += (rand() % 3) - 1;
    } 

         if (x2 <= 0 || x2 >= scr_w - led_width) {
        dx2 = -dx2;
        dx2 += (rand() % 3) - 1;  // Add some randomness (-1 to +1)
    }
    if (y2 <= 0 || y2 >= scr_h - led_height) {
        dy2 = -dy2;
        dy2 += (rand() % 3) - 1;
    } 

         if (x3 <= 0 || x3 >= scr_w - led_width) {
        dx3 = -dx3;
        dx3 += (rand() % 3) - 1;  // Add some randomness (-1 to +1)
    }
    if (y3 <= 0 || y3 >= scr_h - led_height) {
        dy3 = -dy3;
        dy3 += (rand() % 3) - 1;
    } 

    // Keep values within limits
    if (dx1 == 0) dx1 = 1;
    if (dy1 == 0) dy1 = 1;

      if (dx2 == 0) dx2 = 1;
    if (dy2 == 0) dy2 = 1;

      if (dx3 == 0) dx3 = 1;
    if (dy3 == 0) dy3 = 1;

    // Move the object
    lv_obj_set_pos(led1, x1, y_1);
    lv_obj_set_pos(led2, x2, y2); 
    lv_obj_set_pos(led3, x3, y3);
}

